import { useState } from 'react'
import Counter from './components/Counter'
import Header from './components/main/Header'
import MusicList from './components/MusicList'
import Search from './components/Search'
import './index.css'

function App() {
	const [musics, setMusicList] = useState([
		{
			img: 'first_projectsrc\templatesiconsimage.png',
			title: 'Sheker',
			authorName: 'TBRN',
		},
	])
	return (
		<div className='bg-gradient-to-b from-[#FFFFFF] to-[#00000033]'>
			{musics.map(post => (
				<MusicList post={post} />
			))}
			<Header />
			<Search />
			<Counter />
		</div>
	)
}

export default App
